import React, { useState } from "react";

import classes from "./Notes.module.css";

const Notes = (props) => {
  return (
    <div className={classes.Notes}>
      <h3>Notes</h3>
      {props.children.map((item) => {
        return <div key={item._id}>{item.title}</div>;
      })}
    </div>
  );
};

export default Notes;
